package leetcode_170_200;

import org.junit.Test;

public class _214 {

	@Test
	public void test() {
		String s = "";
		System.out.println(getTable(s));
	}

	public String shortestPalindrome(String s) {
		if (s.length() == 0)
			return s;
		int sLength = s.length();
		char[] chars = new char[sLength * 2 + 1];

		for (int i = 0; i < chars.length; i++) {
			chars[i] = i % 2 == 0 ? '#' : s.charAt(i / 2);
		}

		int[] dp = new int[chars.length];

		int max = 0, id = 0;
		for (int i = 0; i < dp.length; i++) {
			dp[i] = i <= max ? 1 : Math.min(dp[2 * id - i], max - i);

			while (i - dp[i] >= 0 && i + dp[i] <= dp.length - 1 && chars[i - dp[i]] == chars[i + dp[i]]) {
				dp[i]++;
			}

			if (dp[i] + i > max) {
				max = dp[i] + i;
				id = i;
			}
		}

		int index = 0;
		for (int i = 0; i < dp.length; i++) {
			if (i + 1 - dp[i] == 0) {
				index = i;
			}
		}

		StringBuilder sb = new StringBuilder();
		if (index == 0) {
			return sb.append(s.substring(1)).reverse().toString() + s;
		} else {
			return sb.append(chars, dp[index] + index, chars.length - index - dp[index]).reverse().toString().replace("#", "") + s;
		}
	}

	private int[] getTable(String s) {
		int[] table = new int[s.length()];
		int index = 0;

		for (int i = 1; i < table.length; i++) {
			if (s.charAt(i) == s.charAt(index)) {
				table[i] = table[i - 1] + 1;
				index++;
			} else {
				index = table[i - 1];

				while (index > 0 && s.charAt(index) != s.charAt(i)) {
					index = table[index - 1];
				}

				if (s.charAt(index) == s.charAt(i)) {
					index++;
				}

				table[i] = index;
			}
		}

		return table;
	}
}
